pragma solidity ^0.7.5;

contract testtest {
    uint test = 1234567890123456789;


    function testCalculation() public view returns(uint) {
        uint fee = test*1/100;
        uint d = test-fee;
        uint collectedFees = fee;

        uint D = d**3/(d**2-((d**2*1)/100));
        fee = D-d;
        collectedFees -=fee;
        return(collectedFees);
    }
}
